import React from 'react';
import { MDBIcon, MDBBtn } from "mdbreact";


const Packages = () => {
    return (
        <div>
            <h1 className="mt-5 text-center">Afforable Packages for Your Business</h1>
            <div className=" text-center">
                <MDBBtn className="package-btns" gradient="peach">Peach</MDBBtn>
                <MDBBtn gradient="purple" className="package-btns">Purple</MDBBtn>
                <MDBBtn gradient="blue" className="package-btns">Blue</MDBBtn>
            </div>


        </div >
    )
}

export default Packages;
